@dariavel Thanks for filing the issue.
@junshi15 Thanks for the quick update.

Note that packages under `contrib` are less well supported by the core TensorFlow team.
I'm marking this as contributions welcome, in case somebody in the community would like to attempt to add verbs support for non-GPU.
